import Dropdown from 'react-dropdown';
import './Home.css'
import './Landing.css';

function InfoRow(course, type, daysLeft, header){
    let row = <tr><td>{course}</td><td>{type}</td><td>{daysLeft}</td></tr>;
    return row;
}

function HomePage() {
  const options = ['MT1', 'MT2', 'MT3'];
  return (
    <body>
        <div className="home-container">
            <div className="wrapper-counter">
                <div className="counter-container">
                    <h1>3</h1>
                </div>
            </div>
            <div className="infoTable">
            <table>
                
            </table>
            </div>
        </div>
    </body>
  );
}

export default HomePage;
